import React from 'react'

const Actions = (props) => {
    const { prod, className } = props
    let className_f = className ? className : ""
    return (
      <React.Fragment>
        <button className={"btn btn-light "+className_f}>x</button>
      </React.Fragment>
    )
}

export default Actions
